import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

let currTime=new Date();
currTime=currTime.getHours();

var greet=["Morning","Afternoon","Night"]

if(currTime>=1 && currTime){
  greet=greet[0]
}else if(currTime>=12){
  greet=greet[1]
}else if(currTime){
  greet=greet[2]
}

ReactDOM.render(
  <>
    <h1>Hello Ambi, Good {greet}</h1>

  </>,
  document.getElementById("root")
);
